import React from 'react';
import { Nav, NavItem, NavLink } from 'reactstrap';

const Uheader = (props) => {
  return (
      <Nav>
        <NavItem>
          <NavLink href="#">Notícias & Mídia</NavLink>
        </NavItem>
        <NavItem>
          <NavLink href="#">contato@dental04.com</NavLink>
        </NavItem>
        <NavItem>
          <NavLink href="#">Seg-</NavLink>
        </NavItem>
        <NavItem>
          <NavLink disabled href="#">Disabled Link</NavLink>
        </NavItem>
      </Nav>
  );
}

export default Uheader;
